import React from 'react';
import Lottie from 'lottie-react';  // Import the Lottie component
import './App.css';

function App() {
  return (
    <div className="App">
      {/* Navigation Bar */}
      <nav className="navbar">
        <h2>Finance Portal</h2>
      </nav>

      {/* Main content */}
      <div className="main-content">
        <h1>
          All things finance,<br /> right here.
        </h1>

        {/* Lottie Animation */}
        <div className="lottie-container">
          <Lottie
            animationData={require('./Animation.json')}  // Load JSON from src folder
            style={{ height: '600px', width: '1000px' }}
            loop={true}  // Ensure looping is enabled
            autoplay={true}  // Ensure autoplay is enabled
          />
        </div>

        {/* Get Started Button */}
        <button className="get-started-button">Get Started</button>
      </div>
    </div>
  );
}

export default App;
